import react from 'react';
import Data from '../Data';
import './style.css';

const Service=()=>{


    return (
        <>
        <div className="service_div">
           <div className="cards">
               <div className="card_img">
                    <img src="https://www.herzing.edu/sites/default/files/styles/fp_960_640/public/2020-09/how-to-become-software-engineer.jpg.webp?itok=3WVOMgAJ" />
               </div>
               <div className="card_title">
                    <h2>Web Development</h2>
               </div>
               <div className="card_para">
                   <p>You never change things by fighting the existing reality. To change something, build a new model that makes the existing model obsolete</p>
               <button>CHECK NOW</button>
               </div>
           </div>
        </div> 
        </>
    )
}

export default Service;
